import React from "react";

const CandidateDashboard = () => {
  return (
    <div className="p-4">
      <h2 className="text-xl font-bold">Candidate Dashboard</h2>
      <p>Welcome, candidate!</p>
    </div>
  );
};

export default CandidateDashboard;
